import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((them) =>({
    fab:{
        position: 'fixed',
        bottom: them.spacing(2),
        left: them.spacing(50),
    },

    fab1:{
        position: 'fixed',
        bottom: them.spacing(2),
        left: them.spacing(80),
    },
}));
